import React from 'react';
import styled from 'styled-components';

const FooterSection = styled.footer`
  background: #0a2239;
  color: #ffffff;
  text-align: center;
  padding: 16px;
  font-size: 14px;
`;

export default function Footer() {
  return (
    <FooterSection>
      © {new Date().getFullYear()} Neuropassos – Cuidando de sua família com carinho e seriedade.
    </FooterSection>
  );
}
